Allison is having a house party and has made it perfectly clear to her mom, Nikita Von James, that she is not to intrude or embarrass Allison in front of her friends. Nikita is crushed by the request and intrudes anyway, thinking snacks will win over Allison's friends. When that doesn't work, Nikita kicks things into high gear; donning a leather jacket and Daisy Dukes, she struts her stuff 'til the party goers can take no more!
